import styled from 'styled-components';

const StyledMain = styled.main`
  color: red;
  font-size: 25rem;
  flex: 1;
  overflow: auto;
`;

const Main = () => (
  <StyledMain>
    <title>asd</title>
  </StyledMain>
);

export default Main;
